INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 1, 1, 70, 1, 'Auditoría Tipo I generalmente se realiza a las entidades que no han pasado una auditoria energética, o aquellas que han pasado por una auditoría sin haber implementado las mejoras recomendadas en un periodo de 3 años. En la Auditoría Tipo I se identifica y evalúa las oportunidades de mejora de bajo costo que pueden ser rápidamente implementadas.');
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 1, 2, 71, 1, '');
