INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 1, 3, 167, 1, '');																				   
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 1, 3, 168, 1, '');
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 1, 4, 75, 1, '');																										
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 2, 1, 70, 1, 'La Auditoría Tipo II se realiza a aquellas entidades que han pasado por una Auditoría Tipo I. En esta auditoría se evalúa si para implementar las mejoras propuestas la entidad requiere financiamiento adicional. Asimismo si ya se han implementado oportunidades de mejora que afecten significativamente el inventario de equipos tambien se recomienda aplicar a una auditoría tipo II.');
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 2, 2, 71, 1, '');
