INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 2, 3, 168, 1, '');																									   
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 2, 4, 75, 1, '');
INSERT INTO SISSELLO.T_MAEM_INDICADOR_FORM (ID_CRITERIO, ID_CASO, ID_COMPONENTE, ID_PARAMETRO, ID_INDICADOR, VALOR) VALUES (6, 3, 1, 70, 1, 'La Auditoría Tipo III se aplica generalmente cuando se busca recurrir a entidades financieras, cooperantes o programas que pueden fondear las oportunidades de mejora, y por tanto el auditor energético debe apoyar la búsqueda de fuentes de financiamiento y el desarrollo del proyecto a presentar, asimismo en una auditoría Tipo III se desarrolla una comprensión detallada del consumo de energía en la entidad dado a la ingeniería a detalle que se aplica.');
